import React from "react";
import PostsCatalog from "../components/PostsCatalog";

const DUMMY_POSTS = [
  {
    id: "p1",
    imageUrl:
      "https://3.bp.blogspot.com/-8q1AX8Ye7Ok/V10lp_JqYDI/AAAAAAAATf8/BjbJDDA5WuAWp_a8rxaYkSEXk7lcvAmDACKgB/s1600/Team%2BBuilding%2Bat%2BHesperides%2BBeach%2BFront%2BResort%2B%2B-%2Bthedailyposh%2B%25286%2529.jpg",
    location: "Binubusan, Lian, Batangas",
    description:
      "Ang magandang kabundukin at karagatan dito sa Matuod, Binubusan.",
    coordinates: {
      lat: 13.9783756,
      lng: 120.62508,
    },
    creator: "u1",
  },
  {
    id: "p2",
    imageUrl: "https://mapio.net/images-p/46378926.jpg",
    location: "Binubusan, Lian, Batangas",
    description:
      "Ang magandang kabundukin at karagatan dito sa Matuod, Binubusan.",
    coordinates: {
      lat: 13.9783756,
      lng: 120.62508,
    },
    creator: "u2",
  },
];

const UserPosts = (props) => {
  return <PostsCatalog bits={DUMMY_POSTS} />;
};

export default UserPosts;
